import React, { useEffect } from 'react';
import api from '../../services/api';

export default function Dashboard() {
    useEffect(() => {
        async function loadSpots() {
            const user_id = localStorage.getItem('user_id')
            const response = await api.get('/dashboard')
        }

        loadSpots();
    }, []);

    return <div />
}
